INSERT INTO `commentaire` (`ID`, `TEXT`, `ID_CLIENT`) VALUES
(1, 'Muy bonitos y la calidad súper!!', 1),
(2, 'Mein Sohn liebt diese Schuhe! Fallen kleiner aus.', 2),
(3, 'Quedan genial puestas, y muy cómodas.Pensé que por el estampado no iban a combinar mucho, pero me las pongo tanto con vaquero azul, como con gris o negro.Estoy encantada.', 3),
(4, 'Super cute slippers but much roomier than other UGG scuff slippers.  There is no sheepskin on the top underside of the slipper which makes the fit different than other styles.  Length is the same.', 4),
(5, 'Loved the fit and color of this sneaker.  However, less than a week out of the box and normal wear, the side of the shoe ripped.  Really surprised that that happened.', 5),
(6, 'Muy buenos tennis.Los pedí tamaño 11 US y me quedaron muy bien, aunque si se pudiera los pediria medio número mas grande ya que su atractivo es el look que tienen al apretar en el empeine.En oferta se pueden conseguir a menos de $1000 pesos (MXN)10/10 Bue', 6),
(7, 'Hochwertig, aber zu klein. Man sollte eine Nummer größer bestellen.', 7),
(8, 'Buenas chanclas para mujer', 8),
(9, 'Molto belle ma troppo piccole', 9),
(10, 'Too big but cute. Order half size down', 10),
(11, 'I ordered a pair of these shoes for my husband who has swollen feet. He absolutely loves how easy it is to put the shoes on and take them off, how light and roomy they are and how easy to walk in them. Excellent product and quality service from Amazon.', 11),
(12, 'Shoe was started to tear ( see above) just in 5 outings on the court.This needs to be replaced', 12),
(13, 'The media could not be loaded.\n                \n\n\n\n\n   They said the shoes was made in Vietnam and I received it just now and it shows made in China..  am so disappointed 😞 😪', 13),
(14, 'Yo pedi talla 20 mx y llego una totalmente diferente, es mas el producto que se ve en la imagen tiene agujeta y el que a mi me llego trae velcro', 14),
(15, 'Super Wander- und Freizeitschuhe in sehr guter Qualität.Ich habe den Schuh in Größe 26 bestellt wo er noch mit Klettverschluss und elastischen Schnürsenkeln kommt. Das ist super für kleinere Kinderfüsse, so lässt sich der Schuh weit öffnen und leicht an- ', 15),
(16, 'love them, just what i had expected looks sturdy as they are fir school in septemberWe love them', 16),
(17, 'Deporte tal cual se describe.. número tal cual pides..cómodos..bonitos y bien de precio..recomendable', 17),
(18, 'etwas breit.Klettverschluss nicht umgelenkt, daher festes schließen schwierig.', 18),
(19, 'sehr gut', 19),
(20, 'Top Schuhe, sehen unheimlich süß aus am Kinderfuß. Der Einstieg ist etwas eng, aber am schmalen Fuß aber sogar barfuß bequem.', 20),
(21, 'Bonitas y cómodas,  buena calidad.', 21),
(22, 'Do not fit like other NB shoes.  They were very long.  They felt like clown shoes.  Sent hem back... they even tried to charge me shipping.  Complained and they relented.', 22),
(23, 'This shirt fit my son perfect. He’s 9 and a little on the small side ( short and thin). A kids size 8 shirt can go 2 ways, 1 just fit him, or be a little too short when he lifts his arms. A kids size 10 is way too big on him. But this shirt fits perfect. ', 23),
(24, 'I chose these shoes specifically because I wanted laced shoes for my toddler. A pair of laced shoes is shown in the photo; however, I received a pair of Velcro shoes in the same color/design. So perhaps, if you order a size 8W, like I did, you may end up ', 24),
(25, 'El envio ha llegado en menos de 24hrs. Repetimos modelo, aunq 1 talla mas, así que hemos ido a lo seguro, porque nos gusta la forma y la ergonimía para un niño de 3 años.', 25),
(26, 'Die Farbe ist viel hübscher als erwartet. Mehr Beere als Rot. Macht einen sehr guten Eindruck, gute Passform. Unser Mädchen zieht sie gerne an.', 26),
(27, 'Unser Tochter (20 M) zieht diese Schuhe sehr gerne an und läuft damit auch gerne herum.Abgesehen davon ist Farbe/Modell sehr schön!', 27),
(28, 'Es wurde Zeit die dicken Winterschuhe zu entsorgen und bleibt man bei diesen Schuhen ist der Übergang bei trockenen Füssen. Sie sind leicht an- und auszuziehen und sehr schick. Wie immer bei Geox 1 Nummer grösser bestellen.', 28),
(29, 'Si tienes niños en edad escolar este es tu calzado perfecto para no arruinarte y que vayan a la última, incluso para hacer deporte específico de atletismo.Como dijo Jack, vamos por partes. En primer lugar hablaremos de este calzado como el típico modelo g', 29),
(30, 'Hochwertig, aber zu klein. Man sollte eine Nummer größer bestellen.', 30),
(31, 'Super Qualität und gut verarbeitet. Macht einen rubusten und hochwertigen eindruck. Das Fußbett, die Sohle und das Leder sind sehr weich. Mein Kind hat keine Druckstellen an dwn Füßen navh dem tragen. Außerdem gibt der Schu einen guten Halt und sieht hübs', 31),
(32, 'Runs small wide is very narrow', 32),
(33, 'Es ist ein gutes Produkt, aber nicht beeindruckend, daher bewerte ich es mit drei Sternen', 33),
(34, 'Ancora più belle che in foto... La piccolina a adorato i suo primi infradito 😉', 34),
(35, 'Talla exacta', 35),
(36, 'Bellissime!!!! Arrivate prestissimo, sandalino bello, comodo e morbidissimo, consigliato!!!!', 36),
(37, 'Ansich ein toller Schuh. Jedoch  ist er leider viel zu schmal obwohl ich bereits 1 Nummer größer gewählt habe und mein Sohn eine normale Fußbreite hat. Wenn er dann auch noch dickere Socken anzieht kommt er gar nicht mehr rein. Der Reißverschluss ist zude', 37),
(38, 'Very curable shoe. Fits as expected. Son loves this shoe.', 38),
(39, 'Lo recomiendo totalmente, calidad precio 👌', 39),
(40, 'Livre exactement à la date par contre pas la bonne couleur', 40);
